/*---Ajax loading for page navigation----*/
$(document).ready(function () {
	$.mobile.ajaxEnabled = false;
});
function RemoveLastContainerBorder() {
    $("div[class*='box']").find("div[class*='container']:last").addClass("no-bottom-border");
}
function SetControlWidth() {
    $("input[type='text'], input[type='number'], input[type='password'],input[type='email'], select").each(function () {
        $(this).width(parseInt($(this).parent().width()) - 5);
    });
}
function ShowOverlay() {
    //topPos = parseInt($(".header").height().toString());
    $("#divOverlay").attr("style", "position:absolute;top:0;left:0px;width:100%;height:" + $(document).height().toString() + "px;z-index:1002;background-color:black;filter:alpha(opacity=80);opacity:0.80;");
    $("#divOverlay").show();
}